import React from "react";
import Collapsible from "../components/collapsibles/Collapsible";
import { MyContext } from "../context";
import { NavMain, BtnTransparent } from "../styledComponents/StyledComps";
import * as Icon from "react-feather";

export default function NavBar() {
  return (
    <MyContext.Consumer>
      {context => (
        <NavMain>
          <Collapsible
            items={[
              {
                heart:{
                name:"likedProducts"
                },
                user:{
                  name:"info",
                  name:"orden",
                  name:"likes",
                  name:"address",
                  name:"logout"
                },
                shoppingCart:{
                  name:"products"
                }
              }
            ]}
            open={context.open}
          />
          <h1 className="logo">MoMe</h1>
          <div className="main-nav-icons">
            <BtnTransparent onClick={context.toggleMenu}>
              <Icon.Heart icon={"heart"} size="24" color="white" />
            </BtnTransparent>
            <BtnTransparent onClick={context.toggleMenu}>
              <Icon.User icon={"user"} size="24" color="white" />
            </BtnTransparent>
            <BtnTransparent onClick={context.toggleMenu}>
              <Icon.ShoppingCart icon={"shoppingcart"} size="24" color="white" />
            </BtnTransparent>


          </div>
        </NavMain>
      )}
    </MyContext.Consumer>
  );
}
